import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import '../css/perfil.css'

const Perfil = () => {
  const { id } = useParams(); // Obtiene el id de la URL
  const [user, setUser] = useState(null);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const response = await fetch(`http://localhost:3000/perfil/${id}`);
        const data = await response.json();
        setUser(data);
      } catch (error) {
        console.error('Error fetching user:', error);
      }
    };

    if (id) {
      fetchUser();
    }
  }, [id]);

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <div className='Body'>
       <div className='imagenPerfil'>
         <h1>empresaimagen </h1> 
       </div>
       <div>
         <div className='usuario'>
           <h2>Nombre: {user.nombreUsuario}</h2>
           <h4>Descripción: {user.descripcion}</h4>
         </div>
         <div className='presentacion'>
           <p>Presentación: {user.present}</p>
         </div>
         <div className='contacto'>
          <div className='contacSect'>
            <p>Email: {user.email}</p>
            <p>Teléfono: {user.tel}</p>
            <p>Otro Teléfono: {user.otroTel}</p>
          </div> 
         </div>
         <div className='ubicacion'>
           <p>Ubicación: {user.ubicacion}</p>
           <p>Ciudad: {user.ciudad}</p>
         </div>
        
         {/* <p>Cuit o Documento: {user.documento}</p> */}
         <div className='redes'>
          <div className='redesSect'>
           <p>Enlace Web: {user.linkWeb}</p>
           <p>Instagram: {user.linkInstagram}</p>
           <p>{user.linkFacebook}</p>
          </div> 
         </div>
         <div className='categorias'>
           <p>Categorías:</p>
           <ul>
            {user.categorias && user.categorias.length > 0 ? (
              user.categorias.map((categoria, index) => (
                <li key={index}>{categoria}</li>
              ))
             ) : (
              <li>No hay categorías</li>
            )}
          </ul>

         </div>
         <p>Enlace Catálogo: {user.linkCatalogo}</p>
       </div>
      </div>
    </div>
  );
};

export default Perfil;
